import React, { Fragment } from "react";
import { Link } from "react-router-dom";
// import { connect } from "mongoose";
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { logout } from '../actions/auth';


const fontGradient = {
  marginTop: "8px",
  marginLeft: "10px",
  fontSize: "40px",
  background: "-webkit-linear-gradient(darkgray, white, black)",
  webkitBackgroundClip: "text",
  webkitTextFillColor: "transparent"
};

const Header = ({ auth: { isAuthenticated, loading }, logout }) => {
  const authLinks = (
    <ul>
      <li>
        <a onClick={logout} to='#!'>
          <i className='fas fa-sign-out-alt'></i>{' '}
          Logout
        </a>

      </li>
    </ul>

  )
  // const guestLinks = (
  //   <div>
  //     <Link className="nav-item left navbar nav-link active" to="/">
  //       Home <span className="sr-only">(current)</span>
  //     </Link>
  //     <Link className="nav-item nav-link" to="/credits">
  //       Credits
  // </Link>
  //     <Link className="nav-item nav-link" to="/listen">
  //       Listen
  // </Link>
  //     <Link className="nav-item nav-link" to="/watch">
  //       Watch
  // </Link>

  //     <Link className="nav-item nav-link" to="/about">
  //       About
  // </Link>
  //     <Link className="nav-item nav-link" to="/contact">
  //       Contact
  // </Link>
  //     <Link className="nav-item nav-link" to="/register">
  //       Register /
  // </Link>
  //     <Link className="nav-item nav-link" to="/login">
  //       Login
  // </Link>

  //   </div >

  // )

  return (
    <div className="header navbar-wrapper">
      {/* LAHUGHESMUSIC */}
      <nav>
        <Link className="navbar-brand" to="#">
          <div className="lahughesmusic-headerfont">
            <h2 style={fontGradient}>LAHughesMusic</h2>
          </div>
          {/* <div className="left"> */}
          <Link className="nav-item left navbar nav-link active" to="/">
            Home <span className="sr-only">(current)</span>
          </Link>
          <Link className="nav-item nav-link" to="/credits">
            Credits
            </Link>
          <Link className="nav-item nav-link" to="/listen">
            Listen
            </Link>
          <Link className="nav-item nav-link" to="/watch">
            Watch
            </Link>

          <Link className="nav-item nav-link" to="/about">
            About
            </Link>
          <Link className="nav-item nav-link" to="/contact">
            Contact
            </Link>
          <Link className="nav-item nav-link" to="/register">
            Register /
            </Link>
          <Link className="nav-item nav-link" to="/login">
            Login
            </Link>

        </Link>
        {!loading && (<Fragment>{isAuthenticated ? authLinks : guestLinks}</Fragment>)}
      </nav>
    </div>
  );
}


Header.propTypes = {
  logout: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
}

const mapStateToProps = state => ({
  auth: state.auth
})

export default connect(mapStateToProps, { logout })(Header)
